import { v4 as uuidv4 } from "uuid";
import { ADD_IMAGE } from './actionTypes';

export const addImage = (image, dispatch,selectShape) => {
    const id = uuidv4();
    dispatch({
      type: ADD_IMAGE,
      payload: { image, id, width: 50, height: 50, x: 100, y: 100 }
    });
    selectShape(id);
  };
